script: |
  super -f text -I q12376.spq | sort > q12376.out

inputs:
  - name: q12376.spq
    data: |
      SELECT col0 * col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN - 8 * + - 26 * + + ( - col2 ) AND + col2 + + - col1 + - ( + 42 ) * 9;
  - name: tab2

outputs:
  - name: q12376.out
    data: |
